import React, {useEffect} from 'react';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';

import Home from './Components/Home';
import CreateWorker from './Workers/CreateWorker';
import Workers from './Workers/Workers';
import MonthlyReport from './Workers/MonthlyReport';
import Sites from './Sites/Sites';
import Login from './Components/Login';

import {Provider} from 'react-redux';
import store from './store';
import setAuthToken from './utils/setAuthToken';
import { loadAdmin } from './actions/AUTH.JS';


if(localStorage.token) {
  setAuthToken(localStorage.token);
}


function App() {

  useEffect(() => {
    store.dispatch(loadAdmin());
  }, [])


  return (
    <Provider store={store}>
      <Router>
        <Switch>
          <Route path='/monthly-report' exact component={MonthlyReport} />
          <Route path='/add-site' exact component={Sites} />
          <Route path='/workers' exact component={Workers} />
          <Route path='/create-worker' exact component={CreateWorker} />
          <Route path='/login' exact component={Login} />

          <Route exact path='/' component={Home} />

        </Switch>
      </Router>
    </Provider>
  );
}

export default App;
